import './App.css';
import { BrowserRouter, Route} from "react-router-dom";
import HOme from "./home";
import Favori from "./favoris";
import Navb from './componant.js/nav';
import JSONDATA from './publicdata.json'


function App() {
  return (
    <div>
      <BrowserRouter>
        <Navb />
          <Route path="/" component={HOme} />
          <Route path="/favoris" component={Favori} />
      </BrowserRouter>
    </div>
  );
}

export default App;
